import { loadState } from '../actions/stateActions';
import { FETCH_PHOTO } from '../actions/types';


const initialState = {
    state: {
        photo: {},
        loading: true
    }
}

//const initialState = loadState();

export default function(state = initialState, action) {
    switch(action.type) {
        case FETCH_PHOTO:
            return {
                ...state,
                photo: action.payload,
                loading: false
            }
        default:
            return state;
    }
}
